import { Link } from "react-router-dom";
import './App.css';

function App() {
  return (
    <div className="App">
      <img src="images/Logo_LSC.png" alt="" />

      <div className="Menu">
        <Link to="/"> Home</Link>
        <Link to="/aboutMe">About Me</Link>
        <Link to="/project">Projects</Link>
      </div>
    </div>
  );
}

export default App;
